import { makeStyles } from '@material-ui/core/styles';

const DrawerStyle = makeStyles((theme) => ({
    body: {
        backgroundColor: '#F5F5F5',
        height: 'inherit'
    },
    head: {
        backgroundColor: '#FFFFFF',
        display: 'flex',
        flexDirection: 'row'
    },
    
    grayIcon: {
        color: '#666666',
    },
    darkGrayText: {
        color: '#333333',
        fontFamily: 'Audiowide',
        fontWeight: '400',
    },
}));

export default DrawerStyle;
